var TargetClient = unwrapExports(targetclient_browser);

const STATUS = 200;
const HEADERS = {
  "Content-Type": "application/json"
}; // Function to create and return the Target client

const createTargetClient = () => {
  return new Promise(resolve => {
    const targetClient = TargetClient.create({
      client: "safewayinc",
      organizationId: "A7BF3BC75245ADF20A490D4D@AdobeOrg",
      propertyToken: "4f1a0288-f0d0-5f83-62d3-ae6a26b3bd6c",
      decisioningMethod: "on-device",
      pollingInterval: 300000,
      artifactLocation: "https://assets.adobetarget.com/safewayinc/production/v1/rules.json",
      targetLocationHint: "34",
      // prevent cluster discovery
      logger: logger,
      fetchApi: httpRequest,
      events: {
        clientReady: () => resolve(targetClient)
      }
    });
  });
}; // Main EdgeWorker event handler


async function onClientRequest(request) {
  try {
    const response = await fetch(request);
    logger.log("Received request", JSON.stringify(request));
    const deliveryRequest = {
      execute: {
        mboxes: [{
          index: 0,
          name: "server-side-mike-ab",
          parameters: {
            foo: "bar"
          }
        }]
      }
    };
    const targetClient = await createTargetClient();
    const targetResponse = await targetClient.getOffers({
      request: deliveryRequest
    });

    const visitorState = lodash.get(targetResponse, "visitorState");

    if (response.headers.get('Content-Type')?.includes('text/html')) {
      const body = await response.text(); // Modify the body to include the script code

      const modifiedBody = body.replace('</head>', `
      <script>
        const visitorState = ${visitorState};
      </script>
    </head>`);
      request.respondWith(createResponse(STATUS, {
        "Content-Type": "text/html"
      }, modifiedBody));
    } else {
      request.respondWith(createResponse(STATUS, {
        headers: HEADERS
      }, JSON.stringify(targetResponse)));
    }

    logger.log("Sending response", JSON.stringify(targetResponse)); // Sending the response directly back to the client

    request.respondWith(createResponse(STATUS, {
      headers: HEADERS
    }, JSON.stringify(targetResponse)));
  } catch (error) {
    logger.error("Error processing the request: " + error.message);
    request.respondWith(createResponse(500, {
      headers: {
        "Content-Type": "text/plain"
      }
    }, "Internal Server Error"));
  }
}

